import { useEffect } from 'react';

export async function GetEvent (data, instance, accounts){

  const request = {
      ...loginRequest,
      account: accounts[0]
  };  

  const tokenProm = instance.acquireTokenSilent(request);

  data.map((user) => {
    console.log(user)
